create database kd;
use kd;

create table produtos(
	id int primary key,
	nome varchar(300),
	link varchar(500)
);

create table cliente(
	id int primary key,
	nome varchar(30),
	sobrenome varchar(50),
	senha varchar(50)
);

create table carrinho(
	id_cliente int,
	id_produto int,
	qtd int,
	foreign key (id_cliente) references cliente(id),
	foreign key (id_produto) references produto(id),
	primary key (id_cliente, id_produto)
);

create table desejo(
	id_cliente int,
	id_produto int,
	qtd int,
	foreign key (id_cliente) references cliente(id),
	foreign key (id_produto) references produto(id),
	primary key (id_cliente, id_produto)
);

